import Logo from "./Logo";
import Menu from "./Menu";

const Header = () => {
  return (
    <div className="header-wrapper">
      <Logo />
      <Menu />
      <style jsx global>
        {`
          .header-wrapper {
            padding: 30px;
            display: flex;
            // justify-content: space-between;
            // align-items: center;
          }

          @media (max-width=600px) {
            .header-wrapper {
              display: block;
              text-align: center;
            }
          }
        `}
      </style>
    </div>
  );
};

export default Header;
